import Typography from "@material-ui/core/Typography";
function Body() {
  return (
    <div className="Body" style={{ height: "200vh" }}>
      <Typography color="secondary" variant="h1" component="h1">
        Hi I'm <br /> Murali Sree Krishna C
      </Typography>
    </div>
  );
}
export default Body;
